-- ----------------------------
-- Table structure for `ad`
-- ----------------------------
DROP TABLE IF EXISTS `ad`;
CREATE TABLE `ad` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `picture_url` varchar(300) NOT NULL COMMENT '图片地址',
  `ad_name` varchar(30) NOT NULL COMMENT '广告名称',
  `ad_link` varchar(300) NOT NULL COMMENT '广告链接',
  `begin_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '开始时间',
  `end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '结束时间',
  `remark` varchar(500) NOT NULL DEFAULT '' COMMENT '客服备注',
  `admin_id` int(10) unsigned NOT NULL COMMENT '管理员ID',
  `create_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `position_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '广告位ID',
  `weight` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '排序正序',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态 1启用2禁用;99:删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT='广告';

-- ----------------------------
-- Records of ad
-- ----------------------------

-- ----------------------------
-- Table structure for `ad_position`
-- ----------------------------
DROP TABLE IF EXISTS `ad_position`;
CREATE TABLE `ad_position` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `call_key` char(40) NOT NULL COMMENT '调用唯一key(大写) 例:CQ_HOME_BANNER',
  `sub_channel` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '子频道',
  `position_name` varchar(30) NOT NULL COMMENT '广告位名称',
  `display_mode` tinyint(1) unsigned NOT NULL COMMENT '展现方式1单图,2多图',
  `width` smallint(5) unsigned NOT NULL COMMENT '宽度单位px',
  `height` smallint(5) unsigned NOT NULL COMMENT '高度px',
  `option` varchar(500) NOT NULL DEFAULT '' COMMENT '其它选项',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态 1启用2禁用;99:删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_call_key_station` (`call_key`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='广告位';

