  `name` varchar(30) CHARACTER SET utf8 NOT NULL COMMENT '账号',
  `password` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '密码',
  `code` varchar(15) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '工号',
  `role_ids` varchar(500) NOT NULL DEFAULT '0' COMMENT '权限组id',
  `position_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '部门id',
