-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `username` varchar(20) DEFAULT NULL COMMENT '登录名',
  `password` char(40) DEFAULT NULL COMMENT '登录密码',
  `path_str` char(8) DEFAULT NULL COMMENT '盐值，进行加密使用',
  `alias_name` varchar(75) DEFAULT NULL COMMENT '昵称',
  `integral` int(10) DEFAULT '0' COMMENT '积分',
  `experience` int(10) DEFAULT '0' COMMENT '经验值',
  `avatar` varchar(300) DEFAULT NULL COMMENT '头像',
  `email` varchar(30) DEFAULT NULL COMMENT '邮箱',
  `sex` enum('男','女') DEFAULT '男',
  `qq_open` varchar(40) DEFAULT NULL COMMENT '如果使用QQ登录需要使用；',
  `register_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `uuid` char(40) DEFAULT NULL COMMENT '用户唯一标识',
