-- ----------------------------
-- Table structure for `user_operation_log`
-- ----------------------------
DROP TABLE IF EXISTS `user_operation_log`;
CREATE TABLE `user_operation_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) DEFAULT NULL COMMENT '登录的用户id',
  `from_type` tinyint(2) DEFAULT '2' COMMENT '来源 1:后台；2 会员中心',
  `operation_type` tinyint(2) DEFAULT '1' COMMENT '操作类型 1 会员登录；2 注册；3 后台员工登录；4 会员申请资质认证；',
  `admin_operation_type` tinyint(2) DEFAULT '0' COMMENT '后台审核操作类型,只针对认证审核相关操作;1 后台通过资质认证；2 后台拒绝资质认证',
  `operation_id` int(10) DEFAULT '0' COMMENT '操作的id（后台员工审核的时候用到，审核的是哪条信息，这里就是那条信息的id）',
  `operation_userid` int(10) DEFAULT NULL COMMENT '操作的id对应的userid（后台员工审核的时候用到，审核的是哪条信息，这里就是那条信息的用户id）',
  `operation_time` timestamp NULL DEFAULT NULL COMMENT '操作时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '操作备注',
  `operation_ip` varchar(30) DEFAULT NULL COMMENT '操作ip',
  `operation_city` varchar(25) DEFAULT NULL COMMENT '所在城市',
  `from_url` varchar(255) DEFAULT NULL COMMENT '请求来源地址',
  `now_url` varchar(255) DEFAULT NULL COMMENT '请求目的地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=286 DEFAULT CHARSET=utf8mb4 COMMENT='用户操作日志记录表';

